syntax = "proto3";
package snapchat.snapdoc;
option optimize_for = CODE_SIZE;
option objc_class_prefix = "SDM";
option csharp_namespace = "SnapProto.Snapchat.Snapdoc";

import "snapchat/unlockables/request/schema/SCULUnlockablesSnapInfo.proto";

message SDMUnlockables {
    .snapchat.unlockables.request.schema.SCULUnlockablesSnapInfo unlockablesSnapInfo = 1;
    bytes encryptedGeoData = 2;
}